  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />

<body>

    window.$docsify = {
      name: '',

      subMaxLevel: 3

<body><script>window.$docsify = {count:{countable:true,fontsize:'0.9em',color:'rgb(90,90,90)',language:'chinese' } }</script>
  <script src="//unpkg.com/docsify-count/dist/countable.js"></script>
